/**
 Font Family: Roboto
 - Roboto-Thin
 - Roboto-Bold
 - Roboto-Medium
 - Roboto-Regular
 */

enum Roboto: String, FontFamily {
    case thin    = "Roboto-Thin"
    case bold    = "Roboto-Bold"
    case medium  = "Roboto-Medium"
    case regular = "Roboto-Regular"
}
